import React from 'react';
import styles from './index.module.css';

const Main = () => {
  return(
    <div className={styles.wrap}>
      <table>
        <tr className={styles.head}>
          <th>Nome</th>
          <th>Telefone</th>
          <th>Nota</th>
          <th>Recomenda</th>
          <th>Opini√£o</th>
        </tr>
        <tr>
          <td>Fulano de Tal</td>
          <td>(88)99861-5555</td>
          <td>10</td>
          <td>Sim</td>
          <td>O arroz estava uma delicia!</td>
        </tr>
      </table>
    </div>
  );
}

export default Main;
